import react from 'React';
import "./style.css";
import { Col, Row } from "../Grid";

function DateRow(props) {
    return (
        <Row id="dateRowDiv">
            <img src="" alt=""></img>
            <Col size="-8">
                <p>{props.date}</p>
            </Col>
            <Col size="-2">
                <p>Season 1 | Week {props.weekNum}</p>
            </Col>
        </Row>
    );
}

export default DateRow;
